INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "キャル", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 106001, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 7001, 7);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "コッコロ", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 105901, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 7002, 7);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "ペコリーヌ", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 105801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 7003, 7);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "ペコリーヌ", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 105801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 10001, 10);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "キャル", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 106001, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 10002, 10);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "コッコロ", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 105901, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 10003, 10);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2030/12/17 14:59:59", "シェフィ", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 106401, 0.0, 0.0, 2, 1, "2015/12/17 15:00:00", -363.0, 0, 10004, 10);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "ペコリーヌ", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 105801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -416.5, 0, 12001, 12);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "キャル", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 106001, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 13001, 13);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "コッコロ", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 105901, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 13002, 13);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2030/12/17 14:59:59", "シェフィ", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 106401, 0.0, 0.0, 2, 1, "2015/12/17 15:00:00", -363.0, 0, 13003, 13);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "ペコリーヌ", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 105801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 13004, 13);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "コッコロ", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 105901, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 14001, 14);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2030/12/17 14:59:59", "シェフィ", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 106401, 0.0, 0.0, 2, 1, "2015/12/17 15:00:00", -363.0, 0, 14002, 14);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "ペコリーヌ", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 105801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 14003, 14);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "キャル", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 106001, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 14004, 14);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "コッコロ", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 105901, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -470.0, 0, 15001, 15);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2030/12/17 14:59:59", "シェフィ", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 106401, 0.0, 0.0, 2, 1, "2015/12/17 15:00:00", -363.0, 0, 16001, 16);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "ペコリーヌ", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 105801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 16002, 16);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "キャル", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 106001, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 16003, 16);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "コッコロ", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 105901, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 16004, 16);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "コッコロ", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 105901, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 17002, 17);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "キャル", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 106001, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 17004, 25);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "コッコロ", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 105901, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 17005, 25);
