INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "カリン", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, 190801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -470.0, 0, 20001, 20);
