INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, "2030/12/17 14:59:59", "シェフィ", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 106401, 0.0, 0.0, 2, 1, "2015/12/17 15:00:00", -363.0, 0, 21003, 21);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "ペコリーヌ", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 105801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 21004, 21);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "カリン", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 190801, 0.0, 0.0, 1, 1, "2015/12/17 15:00:00", -430.0, 0, 22001, 22);
