INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, "2030/12/17 14:59:59", "シズル（バレンタイン）", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 109101, 8.0, 5.23, 5, 2, "2019/01/31 12:00:00", -385.0, 10011, 24015, 24);
